script: |
  super -f text -I q361.spq | sort > q361.out

inputs:
  - name: q361.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + 79 * - 97 + + - 96 NOT IN ( + col1 + col2 + col2 * - col2, - col0 );
  - name: tab1

outputs:
  - name: q361.out
    data: |
      51	14	96
      85	5	59
      91	47	68
